import React from "react";
import { WebView } from 'react-native-webview';
import { StyleSheet } from "react-native";






export default function App() {
  return(

    <WebView 
    source={{uri: 'https://www.youtube.com/'}}
    style={{marginTop: 30}}
    />
  );
  
}
